    bookPos = self.getPosition()
    buildTable()



    bookInfo = JSON.decode(self.getJSON())
    --Adding 1 to offset index that starts at 0
    currentPage = bookInfo['CustomPDF']['PDFPage'] + 1

    for tableName, deployTable in pairs(deploymentTable) do

        if tableName == tostring(currentPage) then

            msg = 'Loading Assets'
            broadcastToAll(msg, {1,1,1})

            Global.call('deployMission', deployTable)


        end

    end


end










